import React from 'react';
import { useRouter } from "next/router";
import Link from 'next/link';
import { modal } from './ModalStyles';

export const Modal = ({ onClose, title }) => {
    console.log(title)
    const handleClose = () => {
        onClose();
    }

    return (
        <modal.Backdrop>
            <modal.Wrapper>
                <modal.BtnClose type="button" onClick={handleClose}>Close</modal.BtnClose>
                <modal.Content>
                    <p>Success!!!</p>
                    <p>{title} was added!</p>
                </modal.Content>
            </modal.Wrapper>
        </modal.Backdrop>
    );
}
